import { Component, Input, OnInit } from '@angular/core';
import { JwtClientService } from '../jwt-client.service';

@Component({
  selector: 'app-edit-task',
  templateUrl: './edit-task.component.html',
  styleUrls: ['./edit-task.component.css']
})
export class EditTaskComponent implements OnInit{

  public task:any;
  constructor(private service:JwtClientService){
    this.task=service.getTask();
  }


  ngOnInit(): void {
    console.log("this",this.task)
  }

}
<form class="mt-3">
    <div class="form-group">
      <label for="formGroupExampleInput">Name</label>
      <input type="text" class="form-control" id="formGroupExampleInput" [value]="task.name" required>
    </div>
    <div class="form-group">
      <label for="formGroupExampleInput2">Start Date</label>
      <input type="text" class="form-control" id="formGroupExampleInput2" [value]="task.startDate"  required>
    </div>


    <div class="form-group">
      <label for="formGroupExampleInput2">End Date</label>
      <input type="text" class="form-control" id="formGroupExampleInput2" [value]="task.endDate" required>
    </div>
    <div class="form-group">
      <label for="formGroupExampleInput2">Status</label>
      <input type="text" class="form-control" id="formGroupExampleInput2" [value]="task.status" required>
    </div>
    <div class="form-group">
      <label for="formGroupExampleInput2">Priority</label>
      <input type="text" class="form-control" id="formGroupExampleInput2" [value]="task.priority" required>
    </div>
    <div class="form-group">
      <label for="formGroupExampleInput2">Progress</label>
      <input type="text" class="form-control" id="formGroupExampleInput2" [value]="task.progress" required>
    </div>
    <button type="submit" class="btn btn-primary mt-3">Update</button>
  </form>
